INSERT INTO `competence_tests_questionitem` VALUES (1,'Bei welcher der folgenden möglichen Anfragen gehen Sie am ehesten von einem Angriff aus?\r\n\r\nBitte sortieren Sie nach diesem Schema: \r\n[1] Ich gehe am ehesten davon aus, dass ein ausgefeilter Angriff vorliegt.  \r\n[2] Ich gehe weniger davon aus, dass ein ausgefeilter Angriff vorliegt. \r\n[3] Ich gehe nicht davon aus, dass ein ausgefeilter Angriff vorliegt.',3,1,1),(2,'Bitte betrachten Sie nochmals dieses Szenario genauer. Was konkret macht DIESE Nachricht zu einem Sicherheitsrisiko?  Wählen Sie die zutreffenden zwei Antworten aus.',2,1,2),(3,'Gehen Sie davon aus, dass diese Nachricht einen Cyberangriff darstellt. Welche Konsequenz könnte ein Fehlverhalten schlimmstenfalls nach sich ziehen?',1,1,3),(4,'Welche der aufgeführten Maßnahmen sollten Sie angesichts dieser Bedrohung als Erstes ergreifen?',1,1,4),(5,'Der erste Schritt besteht darin, die Identität des Absenders zu überprüfen. Warum ist das in dieser Situation wichtig?',1,1,5),(6,'Wie geht man konkret vor, um die Identität des Absenders zu überprüfen?',1,1,6),(7,'Sie haben durch die Identitätsprüfung festgestellt, dass die Nachricht einen Angriff darstellt. Welche ergänzende Maßnahme zur Gefahrenabwehr ist in dieser Situation notwendig?',1,1,7),(8,'Bei welcher der folgenden Nachrichten gehen Sie am ehesten davon aus, dass ein solch ausgefeilter Angriff vorliegt? \r\n\r\nBitte sortieren Sie nach diesem Schema: \r\n[1] Ich gehe am ehesten davon aus,dass ein ausgefeilter Angriff vorliegt. \r\n[2] Ich gehe weniger davon aus, dass ein ausgefeilter Angriff vorliegt. \r\n[3] Ich gehe nicht davon aus, dass ein ausgefeilter Angriff vorliegt.',3,2,1),(9,'Bitte betrachten Sie nochmals dieses Szenario genauer. Was konkret macht DIESE Nachricht zu einem Sicherheitsrisiko?  Wählen Sie die richtigen zwei Antworten aus.',2,2,2),(10,'Gehen Sie davon aus, dass diese Nachricht einen Cyberangriff darstellt. Welche Konsequenz könnte ein Fehlverhalten schlimmstenfalls nac