INSERT INTO `threats_threatarea` VALUES (1,'Kollaborationssysteme','Software oder Plattformen, die die Zusammenarbeit und Kommunikation in einer Organisation unterstützen.'),(2,'Social Media Systeme','Online-Plattformen, die Benutzern ermöglichen, Inhalte zu teilen, zu kommunizieren und zu interagieren'),(3,'Mailsystem','Ein System zum Senden, Empfangen und Verwalten von E-Mails.'),(4,'Instantmessenger','Eine Softwareanwendung, die Echtzeitkommunikation über das Internet ermöglicht.'),(5,'USB-Stick','Ein tragbares Speichergerät, das an einen Computer angeschlossen werden kann, um Daten zu übertragen oder zu speichern.'),(6,'Laptop','Ein tragbarer Computer, der ähnliche Funktionen wie ein Desktop-PC bietet.'),(8,'Internes Informationssystem','Ein System, das von einer Organisation intern genutzt wird, um Daten zu verwalten und zu teilen.'),(9,'Server','Ein Computer oder ein Computersystem, der/das Dienste oder Ressourcen für andere Computer bereitstellt.'),(11,'PC','Ein PC ist ein individueller Computerarbeitsplatz, der für die täglichen Arbeitsaufgaben von Mitarbeitern verwendet wird und eine Vielzahl von Softwareanwendungen ausführt.'),(14,'Online-Banking','Online-Banking bezeichnet die elektronische Abwicklung von Bankgeschäften über das Internet, bei der Kunden Finanztransaktionen wie Überweisungen, Kontostandsabfragen oder Wertpapierhandel bequem über eine Website oder mobile App durchführen können.'),(15,'Online-Shop','Eine eine digitale Verkaufsplattform im Internet, auf der Produkte oder Dienstleistungen angeboten und von Kunden über eine Website oder App erworben werden können.'),(16,'Mitarbeiter','Personen, die in einer Organisation arbeiten und Zugriff auf Informationen haben.'),(17,'Sensible Informationen','Daten, die vertraulich oder geschützt sind, wie persönliche Identifikationsinformationen, finanzielle Daten oder geistiges Eigentum.'),(18,'Netzwerk','Ein System von verbundenen Geräten, das Daten austauscht.'),(19,'Internet Browser','Eine Softwareanwendung, die verwendet wird, um Zugang zum Internet zu erhalten und Webseiten anzuzeigen.'),(20,'Telefon','Ein Kommunikationsgerät, das für Sprachanrufe, Textnachrichten und möglicherweise auch Internetzugang verwendet wird.'),(21,'Buchhaltungssystem','in Buchhaltungssystem ist eine Software, die Geschäftstransaktionen erfasst, Finanzberichte generiert und die Verwaltung von Einnahmen und Ausgaben erleichtert.'),(22,'Smartphone','Mobiltelefon mit Touchscreen und zusätzlichen Funktionen wie GPS und der Möglichkeit, Apps darauf zu installieren');
/*!40000 ALTER TABLE `threats_threatarea` ENABLE KEYS */;
UNLOCK TABLES;

