INSERT INTO `threats_threatsituation` VALUES (1,'Als Vorbereitung für das wöchentliche Jour Fixe des Projekts „Smarte Ventilatoren“ möchten Sie die neuen Lieferanten für die aktuell anstehende Beschaffung der Ventilator-Filter in die Projektskizze eintragen. In diesem Moment erreicht Sie eine Nachricht einer Ihnen unbekannten Person über das interne Kollaborationssystem.',1,1,'2.11'),(2,'Sie sind seit kurzem in einem Social Network aktiv und begeistert von den vielen Möglichkeiten. Besonders erfreut sind Sie darüber, mit bekannten und unbekannten Geschäftskontakten Verbindungen zu knüpfen und immer auf dem Laufenden zu bleiben. Während Ihrer Pause werfen Sie einen Blick hinein und bemerken folgende Nachrichten. Dabei fällt Ihnen wieder ein, dass in den Medien von ausgefeilten Social-Engineering-Angriffen auf KMU berichtet wurde.',2,1,'2.12'),(3,'Kurz bevor Sie in die Mittagspause mit Ihrem Kollegen Mark Kistner aufbrechen wollen, schauen Sie nochmal nach Ihren Mails, da Sie auf ein Angebot von Ihrem Kollegen Lukas Maier warten.',3,1,'2.14'),(5,'Sie kommen nach der Mittagspause an Ihren Arbeitsplatz zurück und schauen in Ihr Mail-Programm, weil Sie auf die Plankosten des neuen Projekts „Smarte Ventilatoren“ von Ihrer Kollegin Anna Brand aus der Abteilung Buchhaltung & Finanzen warten. Dabei fällt Ihnen wieder ein, dass in den Medien von ausgefeilten Malware-Angriffen auf KMU berichtet wurde.',34,1,'2.15'),(11,'Im Rahmen des Projekts „Smarte Ventilatoren“ stehen Sie regelmäßig im Austausch mit Innendienstmitarbeiter Sven Müller, da er für die Verwaltung der Stammkunden zuständig ist. Sie prüfen unterwegs  Ihr dienstliches Instant-Messenger-Konto und stellen fest, dass Sie eine neue Nachricht erhalten haben.',38,7,'4.14'),(16,'Eines Morgens kommt Ihre Assistentin aufgelöst auf Sie zu: \"Können Sie mal bitte mit mir in das Buchhaltungssystem schauen? Irgendwas stimmt mit den Rechnungen nicht!\" Sie zeigt Ihnen an ihrem Bildschirm das Buchhaltungssystem mit einer Beispielrechnung.',21,4,'3.1'),(17,'Sie beginnen Ihren Arbeitstag in der Arneo GmbH und prüfen als erstes Ihr E-Mail-Postfach, weil Sie auf Verkaufszahlen aus dem Projekt warten.',3,4,'3.7'),(20,'Nachdem Sie sich bereits online und auf einer Messe über Team-Koordinationssoftware informiert haben, begegnen Sie in den nächsten Arbeitstagen folgenden Situationen.',61,3,'5.1'),(26,'Heute Vormittag fand eine Team-Besprechung des Projektteams „Smarte Ventilatoren“ statt. Am Ende der Besprechung eilen alle Beteiligten in die Kantine, da heute Currywurst Tag ist.',20,1,'2.8'),(28,'Ihr Kollege Mark Kistner aus der Produktionsabteilung kommt vorbei, um Sie zur Kaffeepause abzuholen. Sie wollen noch schnell eine E-Mail beantworten und bitten ihn, kurz zu warten. Während des Wartens erblickt Mark Kistner einen Ordner auf Ihrem Schreibtisch und fragt: „Kann ich da solange mal reinschauen?“',22,1,'2.5'),(30,'Auf dem Weg zu einem wichtigen Meeting treffen Sie vor der verschlossenen Bürotür eines Kollegen aus der Abteilung IT & EDV auf eine aufgebrachte Frau. Sie kennen diese Frau nicht. Sie erklärt, dass ihr Mann für das Homeoffice einen Dienstrechner benötigt und sie diesen abholen soll.  Ihr Mann habe bereits telefonisch dem Kollegen, vor dessen verschlossener Bürotür sie steht, Bescheid gegeben. Der informierte Kollege ist nun aber nicht auffindbar.',23,1,'2.7'),(31,'Sie sitzen an Ihrem Schreibtisch und das Telefon klingelt.',23,4,'3.8'),(32,'Sie beginnen Ihren Arbeitstag in der Arneo GmbH und loggen sich bei Ihrem internen Kollaborationssystem ein, wie jeden Morgen. Sie stellen fest, dass Sie mehrere Nachrichten erhalten haben. Bitte schauen Sie sich die Anfragen genau an.',1,4,'3.11'),(34,'Im Zuge Ihrer monatlichen Routineaufgaben  möchten Sie sich per SSH / RDP in den Admin Account mehrerer Server einloggen. Nachdem Sie die Zugangsdaten eingegeben haben  erscheint eine Fehlernachricht mit der Meldung  dass die maximalen Versuche aufgebraucht wurden. Sie untersuchen die Logeinträge des Servers und sehen  dass die Anmeldeversuche außerhalb der Geschäftszeiten getätigt wurden. Daraufhin versuchen Sie sich in den Server der Abteilung Vertrieb & Marketing einzuloggen. Dieser zeigt die Nachricht  dass das Passwort falsch ist. Da Sie Ihre Passwörter aber mit einem Passwortmanager verwalten  sind Sie sicher  dass das Passwort korrekt ist.',25,6,'1.3'),(35,'Während Routineaufgaben fällt Ihnen in einer Log Datei auf,  dass außerhalb der Geschäftszeiten der Server der Buchhaltung viele Datenpakete an eine unbekannte IP-Adresse sendet. Durch Zufall finden Sie beim Inspizieren der laufenden Prozesse die dafür verantwortliche Datei. Die Untersuchung der Datei zeigt,  dass sie dafür ausgelegt ist  Daten auszuleiten. Ihre Recherche in einschlägigen Datenbanken für Schwachstellen ist erfolglos.',26,6,'1.4'),(36,'Sie befinden sich an einem Rechner ohne Outlook App. Sie möchten Ihre neuen E-Mails überprüfen und loggen sich daher über den Browser in Ihr Outlookkonto ein. Sie ändern die Einstellung, dass Sie nicht automatisch ausgeloggt werden, da Sie planen, den ganzen Tag an diesem Rechner zu arbeiten. In Ihrer Mittagspause lesen Sie den Ihnen zugeschickten Cybersecurity Newsletter und stoßen dabei auf einen interessanten Beitrag, den Sie mit Ihrer Kollegen teilen wollen. Sie klicken auf den \"Jetzt Teilen\" Button und geben die E-Mail Adresse Ihres Kollegen ein. Sie haben im Nachhinein ein ungutes Gefühl, da Sie den Newsletter nicht abonniert hatten und schauen sich nochmal den Seitenquelltext an.',58,6,'1.7'),(37,'Sie erhalten eine E-Mail  in der die Rechnung für die bestellten Server enthalten ist. Sie öffnen die Rechnung und überprüfen die Preise. Später fragt Sie ein Kollege  warum Sie Ihm eine Word-Datei zugeschickt haben. Sie erinnern sich aber nicht daran  solch eine Datei verschickt zu haben.',28,6,'1.8'),(38,'Sie haben sich angewöhnt, wöchtenlich den Netzwerkverkehrs des Unternehmesnetzwerks der Arneo GmbH mit einem Network Sniffer zu untersuchen. Ihnen fällt auf, dass der PC einer bestimmten Mitarbeiterin ein ungewöhnlich hohes Aufkommen von Netzwerkverkehr verursacht. Sie filtern den entsprechenden Host und sehen, dass jede IP Adresse im Netzwerk angesprochen wird. Sie sprechen die Mitarbeiterin darauf an und fragen sie, ob sie eine ungewöhnliche Situation in letzter Zeit erlebt hat. Die Mitarbeiterin antwortet darauf, dass sie die ganze Woche nur Mails bearbeitet hat und zeig Ihnen ihr Mailprogramm.',29,6,'1.12'),(39,'Sie betreten eines Morgens das Büro und schalten Ihren Rechner ein. Als Sie sich mit dem Server einer Datenbank verbinden, fällt Ihnen auf, dass die Daten, die über Nacht heruntergeladen wurden, nur teilweise und zum Teil korrupt auf dem Server abgelegt wurden.',30,6,'1.1'),(40,'Sie beginnen Ihren Arbeitstag als IT-Admin in der Arneo GmbH. Nach wenigen Minuten stehen zwei Kolleg*innen in Ihrem Büro, die keinen Zugriff auf das System haben und zeitnah eine Lösung von Ihnen verlangen. Schauen Sie sich die folgenden möglichen Situation genau an.',31,6,'1.2'),(41,'Sie betreten morgens Ihr Büro und setzen sich an Ihren Laptop. Diesen haben Sie über Nacht laufen lassen, da Sie ein größeres Softwareprodukt herunterladen wollten. Als Sie den Laptop aufklappen und sich in Ihr Adminkonto einloggen möchten, sehen Sie folgende Nachricht:',32,6,'1.5'),(42,'Als Sie eine Webseite aufrufen, erhalten Sie den Hinweis, dass Ihr Browser veraltet ist. Der Hinweis enthält einen Link zur Downloadseite des Updates. Sie laden das Update herunter und installieren es. Als Sie in der Mittagspause Ihre Kolleg*innen fragen, ob diese schon das Update installiert haben, bekommen Sie die Antwort, dass sie keinen Hinweis erhalten haben.',59,6,'1.6'),(43,'Nach einem langen Tag auf der Ausstellungsmesse der smarten Ventilatoren schauen Sie noch in Ihr Mail-Programm, weil Sie auf eine E-Mail von Sven Müller aus der Abteilung Vertrieb & Marketing bzgl. weiterer Ausstellungsmessen für die smarten Ventilatoren warten. Dabei fällt Ihnen wieder ein, dass in den Medien von ausgefeilten Malware-Angriffen auf KMU berichtet wurde.',34,7,'4.4'),(44,'Sie sind auf einer mehrtägigen Messe, um dort heute die neuen smarten Ventilatoren zu präsentieren und Kundenbeziehungen aufzubauen. Als Messebesucher erhielten Sie einen USB-Stick, auf dem das Messelogo bedruckt ist. Sie bemerken bei Betreten des Messegeländes, dass Sie den USB-Stick im Hotelzimmer vergessen haben, benötigen nun also dringend einen USB-Stick, um die Präsentationsfolien der Administration zu übergeben.',35,7,'4.8'),(45,'Sie sind etwas früher zu einem dienstlichen Termin angereist und suchen nun ein öffentliches WLAN-Netzwerk um noch dringende E-Mails zu beantworten.',55,7,'4.11'),(46,'Sie sind seit kurzem in einem Social Network  aktiv und begeistert von den vielen Möglichkeiten. Besonders erfreut sind Sie darüber, mit bekannten und unbekannten Geschäftskontakten Verbindungen zu knüpfen und immer auf dem Laufenden zu bleiben. Während Ihrer Pause werfen Sie einen Blick in die Plattform und bemerken folgende Nachrichten. Dabei fällt Ihnen wieder ein, dass in den Medien von ausgefeilten Social-Engineering-Angriffen auf KMU berichtet wurde.',37,7,'4.13'),(48,'Ihr Arbeitgeber stellt Ihnen USB Sticks für den täglichen Gebrauch zur Verfügung. Bei dem Verlust eines Gerätes können Sie einen baugleichen neuen anfordern. Sie benutzen den USB Stick in Ihrer täglichen Arbeit und als mobile Möglichkeit Sicherheitskopien anzulegen.',39,7,'4.2'),(49,'Sie nutzen einen Instant-Messenger geschäftlich auf ihrem Diensthandy. Nachdem Sie dort eine Nachricht beantwortet haben, erscheint ein Pop-up Fenster von einem kostenlosen Antivirus Programm, welches Sie noch nie gesehen haben. Es soll Schadsoftware entdeckt haben. Schauen Sie sich die Möglichkeiten genau an.',40,7,'4.5'),(50,'Sie sind im Zug auf einer Dienstreise für Ihren Arbeitgeber, die Arneo GmbH. Gestern hatten Sie ein sehr nettes Gespräch mit einem Kollegen, der sich dieses Jahr noch einen Laptop fürs Home Office kaufen möchte. Just nachdem Sie gestern darüber gesprochen haben bekommen Sie eine der folgenden Nachrichten. Bitte schauen Sie sich die folgenden unterschiedlichen Nachrichten genau an.',41,7,'4.6'),(51,'Sie sind im Zug auf einer Dienstreise für Ihren Arbeitgeber die Arneo GmbH. Sie bekommen eine der folgenden Nachrichten. Bitte schauen Sie sich die folgenden unterschiedlichen Nachrichten genau an.',42,7,'4.7'),(52,'Sie sind Sachbearbeiter*in im Außendienst und befinden sich auf Dienstreise. Sie sind gerade am Flughafen um nach einem wichtigen Termin nach Hause zu fliegen. Sie erwarten aber noch einen wichtigen Anruf bezüglich des heutigen Meetings. Sie bemerken das der Akku Ihres Dienst Handys fast leer ist.',43,7,'4.12'),(53,'Im Rahmen des Projekts „Smarte Ventilatoren“ stehen Sie regelmäßig im Austausch mit Außendienstmitarbeiter Sebastian Schmidt, da er für die Betreuung der Stammkunden zuständig ist. Sie prüfen Ihr dienstliches Instant-Messenging Konto und stellen fest, dass Sie eine neue Nachricht erhalten haben.',44,1,'2.9'),(54,'Wie jeden Morgen prüfen Sie als erstes Ihr E-Mail-Postfach. Sie stellen fest, dass Sie mehrere E-Mails erhalten haben.',45,1,'2.10'),(56,'Morgens in der Rush Hour betreten Sie einen Bereich, der ausschließlich für autorisiertes Personal zugänglich ist und überwacht wird. Dabei fällt Ihnen etwas Außergewöhnliches auf.',56,1,'2.2'),(57,'Es ist der 09.07.2022 und Sie beginnen Ihre Arbeit für Ihre Firma, die Arneo GmbH, und bekommen eine Push-Mitteilung auf Ihr Smartphone. Bitte schauen Sie sich die folgenden Nachrichten genau an.',38,4,'3.6'),(58,'Im Rahmen des Projekts „Smarte Ventilatoren“ stehen Sie regelmäßig im Austausch mit Außendienstmitarbeiter Sebastian Schmidt, da er für die Betreuung der Stammkunden zuständig ist. Sie prüfen Ihr dienstliches Instant-Messenging-Konto und stellen fest, dass Sie eine neue Nachricht erhalten haben.',44,4,'3.9'),(59,'Kurz bevor Sie in die Mittagspause aufbrechen wollen, schauen Sie nochmal in das Mail-Programm, da Sie auf ein Angebot von Ihrem Kollegen Lukas Maier warten.',45,4,'3.10'),(60,'Vor 10 Jahren wurde bei der Einrichtung des neuen Büros, eine Vielzahl an USB-Sticks angeschafft, welche seither genutzt werden, um Daten intern weiterzugeben oder um Daten ohne jeglichen Internetzugang speichern zu können. Da die Datenträger mittlerweile in die Jahre gekommen sind, lassen sich vermehrt darauf gespeicherte Ordner nicht mehr öffnen, wodurch der Inhalt nun unzugänglich geworden ist.',39,4,'3.13'),(61,'Um den Budget-Plan zu erstellen, öffnen Sie die Buchhaltungssoftware und loggen sich wie üblich. Das Mitarbeiterkürzel SE, das abbildet, wer die  Buchungen vorgenommen hat, ist Ihnen bekannt.',60,4,'3.2'),(62,'Sie beginnen an diesem Morgen Ihren Arbeitstag in der Arneo GmbH und wollen sich an Ihrem Computer anmelden.',50,3,'5.2'),(63,'Sie befinden sich auf Dienstreise. Sie sind gerade am Flughafen, um nach einem wichtigen Termin nach Hause zu fliegen. Sie erwarten aber noch einen wichtigen Anruf bezüglich des heutigen Meetings. Sie bemerken, dass der Akku Ihres Diensthandys fast leer ist.',43,3,'5.6'),(65,'Sie öffnen am Dienstagmorgen Ihr E-Mail-Postfach und sehen folgende E-Mails:',34,3,'5.26'),(66,'Sie haben von einem Freund den Tipp für eine App bekommen, die Ihnen helfen soll, Ihre Konzentrations- und Pausenzeit zu optimieren. Sie suchen im Store nach einer solchen App, weil Sie das ausprobieren wollen.',53,3,'5.4'),(67,'Sie bekommen eine Push-Mitteilung auf Ihr Dienst-Smartphone. Bitte schauen Sie sich die folgenden Nachrichten genau an.',38,3,'5.20'),(69,'Sie beginnen Ihren Arbeitstag in der Arneo GmbH und prüfen als erstes Ihr E-Mail-Postfach',3,3,'5.21'),(70,'Sie öffnen zu Arbeitsbeginn Ihre Cloud und stellen Folgendes fest:',56,3,'5.12'),(72,'Sie erhalten eine Mail von einer E-Mail-Adresse, die nicht in Ihrem Adressbuch ist. Der Absender stellt sich als Mitglied der Finanzabteilung vor. Sie werden gebeten, sich über den Link in der E-Mail auf der Website der Bank anzumelden, bei der die Arneo GmbH ein Konto besitzt. Die Bank heißt \"Sicherbank\". Stellen Sie sich nun folgende Szenarien vor:',57,3,'5.23'),(73,'Ein Schülerpraktikant kommt in Ihr Büro und zeigt Ihnen seinen Dienst-Laptop: \"Haben Sie mal kurz Zeit für mich? Ich soll die Bestellungen der letzten Monate zählen und daraus die Schwankungen ermitteln. Irgendwie bin ich jetzt aber nicht im Bestellsystem gelandet, wo muss ich denn hier klicken? Ich kenne mich noch nicht so gut aus, ich bin erst seit einer Woche da.\"',56,4,'3.14'),(74,'Sie sind etwas früher zu einem dienstlichen Termin angereist und suchen nun ein öffentliches WLAN-Netzwerk um noch ein paar dringende E-Mails zu beantworten.',55,3,'5.5'),(75,'An Ihrem ersten Arbeitstag nach Ihrem Sommerurlaub möchten Sie sich am PC anmelden und werden aufgefordert Ihr Passwort zu ändern.',50,1,'2.3'),(76,'Nachdem Sie sich bereits online und auf einer Messe über Team-Koordinationssoftware informiert haben, begegnen Sie in den nächsten Arbeitstagen folgenden Situationen.',61,3,'5.1');
