INSERT INTO `threats_threatvector` VALUES (1,1,1,'Der Angreifer benutzt Kollaborationssysteme (z. B. Asana, Teams) mit der Absicht, Personen innerhalb von Organisationen zu überreden oder auf andere Weise dazu zu bringen, kritische/sensible Informationen (z. B. personenbezogene Daten) preiszugeben.'),(2,2,1,'Der Angreifer benutzt Social-Media-Systeme (z.B. Facebook, Twitter) mit der Absicht, Personen innerhalb von Organisationen zu überreden oder auf andere Weise dazu zu bringen, kritische/sensible Informationen (z. B. personenbezogene Daten) preiszugeben.'),(3,3,2,'Der Angreifer fälscht E-Mails, um an vertrauliche Informationen wie Benutzernamen oder Kennwörter zu gelangen. Die Benutzer werden in der Regel auf scheinbar legitime Webseiten geleitet, während die eingegebenen Informationen in Wirklichkeit gestohlen werden. Der Angreifer setzt u. U. Phishing-Angriffe ein, die auf hochrangige Ziele abzielen (z. B. leitende Angestellte/Führungskräfte).'),(6,5,3,'Der Angreifer platziert Wechseldatenträger (z. B. Flash-Laufwerke), auf denen Malware platziert wurde, an Orten inner- oder außerhalb der physischen Umgebung des Unternehmens, an denen die Mitarbeiter die Datenträger wahrscheinlich finden (z. B. in Konferenzen, an den Arbeitsplätzen der Mitarbeiter) und auf den Informationssystemen des Unternehmens verwenden.'),(8,2,5,'Der Angreifer erlangt Zugang zum Social-Media-Account des Opfers und nutzt ihn vor bösartige Zwecke.'),(18,14,13,'tbd'),(19,15,14,'tbd'),(20,16,15,'Diese Art von Bedrohung kann verschiedene Formen annehmen. Ein Mitarbeiter könnte versehentlich sensible Daten an falsche Empfänger senden, beispielsweise durch einen Fehler bei der Adressierung einer E-Mail oder durch die Auswahl eines falschen Empfängers in einer Datenbank. Eine andere Möglichkeit ist der mutwillige Diebstahl oder die Weitergabe vertraulicher Informationen durch einen Mitarbeiter, sei es aus finanziellen Motiven, Rache, Nachlässigkeit oder Unwissenheit über die Bedeutung der Daten.'),(21,21,16,'Der Bedrohungsvektor \"Ausnutzung von Schwachstellen in internen Informationssystemen\" bezieht sich auf Angriffe, die gezielt Schwächen in den internen IT-Systemen einer Organisation ausnutzen, insbesondere in solchen, die kritische Funktionen wie Buchhaltung ausführen. Angreifer könnten dabei Schwachstellen wie veraltete Software, unzureichend gesicherte Netzwerke oder menschliche Fehler ausnutzen.'),(22,16,34,'Der Bedrohungsvektor \"Weitergabe sensibler Informationen durch Mitarbeiter*innen\" umfasst das Risiko, dass interne Informationen durch das Handeln von Mitarbeitern unbeabsichtigt oder absichtlich außerhalb der Organisation geteilt werden. Dies kann durch direkte Weitergabe von Daten, unzureichend gesicherte Kommunikationskanäle oder durch den Verlust von Datenträgern und Endgeräten geschehen.'),(23,16,1,'Dieser Bedrohungsvektor beschreibt „Social Engineering-Angriffe auf Mitarbeiter*innen“, bei denen Angreifer psychologische Manipulation anwenden, um vertrauliche Informationen zu erhalten oder Sicherheitsbarrieren zu umgehen. Dies kann zu unberechtigtem Zugang zu sensiblen Daten oder Systemen und der Gefährdung der gesamten IT-Sicherheit führen.'),(25,9,17,'Der Angreifer versucht, sich durch zufälliges oder systematisches Erraten von Passwörtern Zugang zu den Informationssystemen eines Unternehmens zu verschaffen, möglicherweise mit Hilfe von Programmen zum Knacken von Passwörtern.'),(26,9,10,'Hierbei nutzt der Angreifer bislang unbekannte Schwachstellen in Informationssystemen aus, um Zugriff zu erlangen, ohne dass es ein spezifisches Ziel oder eine bestimmte Absicht gibt.'),(27,3,36,'Der Angreifer nutzt komplexere Übermittlungsmechanismen als E-Mail (z. B. Internetverkehr, Instant Messaging, FTP), zum Übermitteln von (modifizierter) Malware, um sich so Zugang zu internen Informationssystemen des Unternehmens zu verschaffen.'),(28,3,37,'Der Angreifer installiert Malware, die speziell darauf ausgelegt ist, die Kontrolle über die internen Informationssysteme eines Unternehmens zu übernehmen, vertrauliche Informationen zu identifizieren und diese Informationen zu exfiltrieren.'),(29,18,10,'Hierbei nutzt der Angreifer bislang unbekannte Schwachstellen in Informationssystemen aus, um Zugriff zu erlangen, ohne dass es ein spezifisches Ziel oder eine bestimmte Absicht gibt.'),(30,9,38,'Beschädigung bzw. Überalterung einer Reihe von Laufwerken, die alle zur gleichen Zeit vom gleichen Anbieter erworben wurden.'),(31,9,25,'Ein Angreifer versucht, eine über das Internet zugängliche Ressource für die beabsichtigten Benutzer unzugänglich zu machen oder zu verhindern, dass die Ressource effizient oder überhaupt funktioniert, vorübergehend oder auf unbestimmte Zeit.'),(32,6,17,'Der Angreifer versucht, sich durch zufälliges oder systematisches Erraten von Passwörtern Zugang zu den Informationssystemen eines Unternehmens zu verschaffen, möglicherweise mit Hilfe von Programmen zum Knacken von Passwörtern.'),(33,19,36,'Der Angreifer nutzt komplexere Übermittlungsmechanismen als E-Mail (z. B. Internetverkehr, Instant Messaging, FTP), zum Übermitteln von (modifizierter) Malware, um sich so Zugang zu internen Informationssystemen des Unternehmens zu verschaffen. In diesem Fall tut er dies über den Internet-Browser, zum Beispiel über eine gefälschte Wbesite.'),(34,3,3,'Der Angreifer nutzt gängige Übermittlungsmechanismen (z. B. E-Mail), um Malware in Informationssysteme von Unternehmen zu installieren/einzuschleusen.'),(35,5,7,'Der Angreifer verteilt Wechseldatenspeicher mit Malware, die das Opfer an eigenen Geräten nutzt.'),(37,2,2,'Dieser Bedrohungsvektor beschreibt „Phishing-Angriffe auf Social-Media-Systeme“, bei denen Angreifer gefälschte Nachrichten oder Websites nutzen, um Zugangsdaten oder sensible Informationen von Mitarbeiter*innen zu stehlen. Dies kann zu unautorisiertem Zugriff auf Unternehmens- oder persönliche Konten und zur Verbreitung weiterer schädlicher Inhalte führen.'),(38,4,2,'Phishing ist der Versand gefälschter E-Mails, die Menschen dazu verleiten sollen, auf einen Betrug hereinzufallen. Phishing-Mails zielen häufig darauf ab, dass die Nutzer Finanzinformationen, Zugangsdaten oder andere sensible Daten preisgeben. In diesem Fall findet der Angriff über einen Instant-Messenger statt.'),(39,5,31,'Beschädigung des Speichers aufgrund eines Festplattenfehlers/Mehrere Festplattenfehler aufgrund der Alterung einer Reihe von Geräten, die möglicherweise alle zur gleichen Zeit vom gleichen Anbieter erworben wurden.'),(40,4,3,'Der Angreifer nutzt gängige Übermittlungsmechanismen (z. B. E-Mail), um Malware in Informationssysteme von Unternehmen zu installieren/einzuschleusen.'),(41,4,36,'Der Angreifer nutzt komplexere Übermittlungsmechanismen als E-Mail (z. B. Internetverkehr, Instant Messaging, FTP), zum Übermitteln von (modifizierter) Malware, um sich so Zugang zu internen Informationssystemen des Unternehmens zu verschaffen.'),(42,4,37,'Der Angreifer installiert Malware, die speziell darauf ausgelegt ist, die Kontrolle über die internen Informationssysteme eines Unternehmens zu übernehmen, vertrauliche Informationen zu identifizieren und diese Informationen zu exfiltrieren und verwendet dazu als Einfallstor einen Instant-Messenger..'),(43,20,26,'Der Angreifer installiert Malware auf Unternehmenstelefonen, während sich diese Geräte außerhalb des Unternehmens befinden, um anschließend das Unternehmen zu infizieren, wenn es wieder an Unternehmensnetzwerke angeschlossen wird.'),(44,4,1,'Beim Social Engineering nutzt der Täter den \"Faktor Mensch\" als vermeintlich schwächstes Glied der Sicherheitskette aus, um seine kriminelle Absicht zu verwirklichen. Als Einfallstor kann hierfür der Instant-Messenger genutzt werden.'),(45,3,1,'Beim Social Engineering nutzt der Täter den \"Faktor Mensch\" als vermeintlich schwächstes Glied der Sicherheitskette aus, um seine kriminelle Absicht zu verwirklichen.'),(47,16,39,'Dieser Bedrohungsvektor beschreibt die mangelhafte Absicherung von Zugriffsrechten auf sensible Systeme und Daten. Dies kann zu unberechtigtem Zugriff, Datenmissbrauch oder der unautorisierten Weitergabe von vertraulichen Informationen führen.'),(49,21,10,'Hierbei nutzt der Angreifer bislang unbekannte Schwachstellen in Informationssystemen aus, um Zugriff zu erlangen, ohne dass es ein spezifisches Ziel oder eine bestimmte Absicht gibt.'),(50,11,17,'Der Bedrohungsvektor \"Durchführung von Brute-Force-Anmeldeversuchen bzw. Passworterratraten\" bezieht sich auf Angriffe, die darauf abzielen, durch systematisches Ausprobieren aller möglichen Passwörter (Brute-Force) oder durch geschicktes Raten basierend auf gängigen Passwörtern oder leicht zugänglichen Informationen des Benutzers (Passworterraten) Zugang zu einem Computer zu erlangen.'),(53,22,29,'Dieser Bedrohungsvektor beschreibt Angriffe auf Smartphones durch die Nutzung bereits identifizierter und öffentlich dokumentierter Sicherheitslücken. Diese Angriffe können zu Datenverlust, unerlaubtem Zugriff auf sensible Informationen oder der Kontrolle über das Gerät führen.'),(55,6,26,'Der Angreifer installiert Malware auf Laptops, während sich dieses Gerät außerhalb des Unternehmens befindet, um anschließend das Unternehmen zu infizieren, wenn es wieder angeschlossen ist.'),(56,16,41,'Ein autorisierter Benutzer oder Administrator weist einem Benutzer fälschlicherweise außergewöhnliche Berechtigungen zu.'),(57,14,32,'Der Angreifer erstellt Duplikate von einer Online-Banking-Seite. Wenn Benutzer die Seite besuchen, kann diese Informationen sammeln oder Malware herunterladen.'),(58,3,42,'Hierunter werden Angriffstechniken verstanden, bei denen Malware über E-Mail-Nachrichten in ein internes Netzwerk oder System eingeschleust wird. Diese Art von Angriff nutzt das Mailsystem als Transportmittel, um schädliche Software an die Zielorganisation zu liefern.'),(59,19,42,'Hierunter werden Angriffstechniken verstanden, bei denen Schadsoftware (Malware) über den Internetbrowser in ein System eingeschleust wird. Dies erfolgt durch die Ausnutzung von Schwachstellen oder durch Täuschung der Benutzer, um schädliche Software herunterzuladen und auszuführen.'),(60,21,43,'Dieser Bedrohungsvektor beschreibt die gezielte Ausnutzung unbekannter oder ungepatchter Sicherheitslücken, bevor entsprechende Updates oder Gegenmaßnahmen verfügbar sind. Diese Angriffe können zu unautorisiertem Zugang, Manipulation von Finanzdaten oder vollständigem Systemausfall führen.'),(61,11,20,'Dieser Bedrohungsvektor beschreibt die Kompromittierung privater Endgeräte, die für berufliche Zwecke genutzt werden und weniger Sicherheitsmaßnahmen aufweisen als firmeneigene Systeme. Diese Angriffe können zu Datendiebstahl, unberechtigtem Zugang zu Unternehmensressourcen oder der Verbreitung von Schadsoftware führen.');
